import styled from "styled-components";

export const CollectionPreviewContainer = styled.div`
    display: flex;
    flex-direction: column;
    margin-bottom: 30px;
`;

export const Title = styled.div`
    font-size: 28px;
    margin-bottom: 25px;
`;

export const Preview = styled.div`
    display: flex;
    justify-content: space-between;
`
